HCUPnet is an on-line query system that provides free, instant access to the largest set of all-payer health care databases that are publicly available. Using HCUPnet's easy step-by-step query system, you can generate tables and graphs on statistics and trends for acute care hospitals in the U.S.

HCUPnet provides:
?   National and regional estimates for inpatient stays and emergency department visits;
?   State counts of inpatient stays and emergency department visits for those states that agreed to participate;
?   National estimates on readmissions and readmission rates;
?   National and regional information on quality of care in hospitals and potentially preventable admissions, based on the AHRQ Quality Indicators (QIs);

For most queries, detailed information is available for conditions and procedures (by ICD-9-CM codes and Clinical Classification Software), and for diagnosis related groups (DRGs).

HCUPnet allows easy access to information from datasets that are part of the Healthcare Cost and Utilization Project (HCUP); details on obtaining these datasets are also available in http://www.healthdata.govwww.healthdata.gov

This map can be used to find an Indian Health Service, Tribal or Urban Indian Health Program facility. This map can be used to:&#13;
Zoom in to a general location to see if there is a facility in that region.&#13;
Enter your current location in the form to see the facilities available.&#13;
Find a specific facility by selecting the "Facility Information" tab and typing in the name of the facility that you are trying to find.&#13;

RadLex is a controlled terminology for radiology and serves as a single unified source of radiology terms for radiology practice, education, and research. RadLex is a comprehensive lexicon for standardized indexing and retrieval of radiology information resources. With more than 30,000 terms, RadLex satisfies the needs of software developers, system vendors and radiology users by adopting the best features of existing terminology systems while producing new terms to fill critical gaps. RadLex also provides a comprehensive and technology-friendly replacement for the ACR Index for Radiological Diagnoses. It unifies and supplements other lexicons and standards, such as SNOMED-CT, LOINC, and DICOM. As images, image reports, and medical records continue to move online RadLex meets the need of physicians to organize and retrieve image data using a common set of terms.&#13;
&#13;
RadReport is a radiology reporting initiative that is a part of RadLex. RadReport aims to improve reporting practices by creating a library of clear and consistent report templates.  Report templates and information about RadReport is available at the link in Resource 2.&#13;
